import{_ as t,o as e,c as a,O as r}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 62.1-132.4 Rates and rate structures.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/62.1-132.4.md","filePath":"vacode/62.1-132.4.md"}'),n={name:"vacode/62.1-132.4.md"},o=r('<h1 id="§-62-1-132-4-rates-and-rate-structures" tabindex="-1">§ 62.1-132.4 Rates and rate structures. <a class="header-anchor" href="#§-62-1-132-4-rates-and-rate-structures" aria-label="Permalink to &quot;§ 62.1-132.4 Rates and rate structures.&quot;">​</a></h1><p>The Authority shall have power to establish a traffic bureau or other office to investigate and seek improvement in any rates, rate structures, practices, and charges affecting or tending to affect the commerce of the ports of the Commonwealth. Notwithstanding any provision of law to the contrary, the Authority shall not disclose proprietary information and data furnished to it in confidence, including but not limited to customer contracts, agreements, or information; ship tally sheets; ship manifests; information relating to tonnages and cargoes; annual budgets; and other information furnished to it by any entity, including but not limited to any entity operating a terminal on behalf of the Virginia Port Authority.</p><p>1981, c. 589; 1997, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0197" target="_blank" rel="noreferrer">197</a>; 2013, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0762" target="_blank" rel="noreferrer">762</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0794" target="_blank" rel="noreferrer">794</a>.</p>',3),i=[o];function s(c,l,h,d,f,u){return e(),a("div",null,i)}const g=t(n,[["render",s]]);export{p as __pageData,g as default};
